import React from "react";
import './MainContent.css';

const MainContent = () => {

    return(
        <>
            <div className="homeBlock">
                <h1 className='content' style={{marginTop: "0px"}}>Boost your efficiency and simplify your workflow effortlessly with <br></br>
                    <span style={{color: "#e95f6a"}}>Active</span>
                    <span style={{color: "#143ea1"}}>Campaign</span>
                    <span style={{color: "#e95f6a"}}>Connect</span>
                </h1>
                <p>
                Streamline the synchronization and administration of your ActiveCampaign data through the user-friendly Monday.com platform.
                This integration not only guarantees exceptional efficiency but also fosters smooth collaboration within a unified workspace.
                </p>
            </div>
        </>
    );
}

export default MainContent;
